let lazySortedCodes: NgrokErrorCode[] | undefined;
function sortedCodes(): NgrokErrorCode[] {
  if (lazySortedCodes == null) {
    lazySortedCodes = Object.values(NgrokErrorCode).sort();
  }
  return lazySortedCodes;
}

function binarySearchErrorCodes(
  value?: unknown,
  start: number = 0,
  end: number = sortedCodes().length - 1
): NgrokErrorCode | undefined {
  if (start > end || typeof value !== 'string') {
    return undefined;
  }

  const middle = Math.floor((start + end) / 2);
  const list = sortedCodes();
  if (list[middle] === value) {
    return value;
  }

  if (list[middle].localeCompare(value) > 0) {
    return binarySearchErrorCodes(value, start, middle - 1);
  }
  return binarySearchErrorCodes(value, middle + 1, end);
}
